import React from "react";


const LeftSection = () => {
    return (
      <div className="left-section left-box">
        <h2 className="upper section1">WORLDUNIVERSITY</h2>
        <p>
        WorldUniversity is a new platform developed by PT World University to help students get detailed information about various countries around the world. This platform provides various features such as searching for country data, flags, locations, as well as filtering country data based on certain criteria. The platform is designed to provide an easy and informative experience for users.
        </p>
      </div>
    );
  };

  export default LeftSection;
